-- ----------------------------
-- Table structure for area
-- ----------------------------
DROP TABLE IF EXISTS `area`;
CREATE TABLE `area` (
  `id` int(11) NOT NULL,
  `name` varchar(20) NOT NULL,
  `pid` int(11) NOT NULL,
  `level` int(11) NOT NULL COMMENT '行政级别：1（省）、2（市）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='业务覆盖区域的区划信息';

-- ----------------------------
-- Records of area
-- ----------------------------

-- ----------------------------
-- Table structure for business
-- ----------------------------
DROP TABLE IF EXISTS `business`;
CREATE TABLE `business` (
  `id` char(15) NOT NULL,
  `createtime` datetime NOT NULL COMMENT '订单生成时间',
  `location` int(11) NOT NULL COMMENT '当前地址',
  `reachplace` int(11) NOT NULL COMMENT '收获地址',
  `status` int(2) NOT NULL DEFAULT '0' COMMENT '状态：0（待发货）、1（待收货）、2（送达）',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of business
-- ----------------------------

-- ----------------------------
-- Table structure for b_seq
-- ----------------------------
DROP TABLE IF EXISTS `b_seq`;
CREATE TABLE `b_seq` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `value_` int(11) NOT NULL DEFAULT '1' COMMENT '值',
  `increment` int(11) NOT NULL DEFAULT '1',
  `createtime` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='自增长序列\r\n';

-- ----------------------------
-- Records of b_seq
-- ----------------------------

-- ----------------------------
-- Table structure for car
-- ----------------------------
DROP TABLE IF EXISTS `car`;
CREATE TABLE `car` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `carno` varchar(10) NOT NULL COMMENT '车牌号码',
  `weight` double(8,2) DEFAULT '0.00' COMMENT '空车重量/kg',
  `maxload` double(8,2) DEFAULT '0.00' COMMENT '最大载重/kg',
  `loading` double(8,2) DEFAULT '0.00' COMMENT '当前载重/kg',
  `servicedate` date NOT NULL COMMENT '服役日期',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '状态：0（营运）、1（闲置）、2（退役）',
  `location` int(11) NOT NULL DEFAULT '404' COMMENT '当前所在位置',
  `transcounts` int(11) DEFAULT '0' COMMENT '运输总次数',
  `kilometers` double DEFAULT '0' COMMENT '运输总公里数',
  `remark` varchar(50) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of car
-- ----------------------------

-- ----------------------------
-- Table structure for cargo
-- ----------------------------
DROP TABLE IF EXISTS `cargo`;
CREATE TABLE `cargo` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL COMMENT '商品名称',
  `weight` double(8,2) NOT NULL DEFAULT '0.00' COMMENT '商品重量/kg',
  `rest` int(6) NOT NULL DEFAULT '0' COMMENT '库存量',
  `made` varchar(30) DEFAULT NULL COMMENT '产地',
  `maker` varchar(30) DEFAULT NULL COMMENT '生产商',
  `type` int(4) DEFAULT NULL COMMENT '商品类别',
  `remark` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='货物基本信息表';

-- ----------------------------
-- Records of cargo
-- ----------------------------

-- ----------------------------
-- Table structure for dic_region
-- ----------------------------
DROP TABLE IF EXISTS `dic_region`;
CREATE TABLE `dic_region` (
  `ID` char(14) NOT NULL COMMENT '区划编号',
  `NAME` varchar(50) NOT NULL COMMENT '名称',
  `SHORT_NAME` varchar(20) DEFAULT NULL COMMENT '简称',
  `VALIDITY` int(1) NOT NULL DEFAULT '1' COMMENT '是否有效, 1：是，0：否',
  `LIST_NUM` char(11) NOT NULL,
  `L_LEVEL` char(1) NOT NULL,
  `FATHER_ID` char(14) NOT NULL,
  `D_DESCRIBE` varchar(20) DEFAULT NULL COMMENT '描述',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of dic_region
-- ----------------------------

-- ----------------------------
-- Table structure for driver
-- ----------------------------
DROP TABLE IF EXISTS `driver`;
CREATE TABLE `driver` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cert_id` char(18) NOT NULL COMMENT '身份证号码',
  `tel` char(11) NOT NULL COMMENT '手机号码',
  `location` int(11) NOT NULL DEFAULT '404' COMMENT '当前驻地',
  `kilometers` double(8,2) NOT NULL DEFAULT '0.00' COMMENT '运送总公里数',
  `transcounts` int(11) NOT NULL DEFAULT '0' COMMENT '运送次数',
  `name` varchar(50) DEFAULT NULL,
  `age` int(11) unsigned DEFAULT '0',
  `gender` int(11) DEFAULT '0' COMMENT '性别：0（男）、1（女）',
  `hiredate` date DEFAULT NULL,
  `status` int(11) DEFAULT '0' COMMENT '状态：0（待命）、1（忙碌）、2（休息）、3（离职）',
  `census` varchar(50) DEFAULT NULL,
  `remark` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

