-- ----------------------------
-- Procedure structure for reset_seq
-- ----------------------------
DROP PROCEDURE IF EXISTS `reset_seq`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `reset_seq`()
BEGIN
	UPDATE b_seq SET value_ = value_ - 1,createtime = NOW() 
	WHERE TIME_TO_SEC( TIMEDIFF(sysdate(),createtime) ) > 3600;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for nextval
-- ----------------------------
DROP FUNCTION IF EXISTS `nextval`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `nextval`(`id` int) RETURNS int(11)
BEGIN
	#Routine body goes here...
	DECLARE val int;
	SET val = (SELECT value_ FROM b_seq where id = id);
	
	UPDATE b_seq SET value_ = val + increment WHERE id = id;
	RETURN val;
END
;;
DELIMITER ;

-- ----------------------------
-- Event structure for update_seq
-- ----------------------------
DROP EVENT IF EXISTS `update_seq`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` EVENT `update_seq` ON SCHEDULE EVERY 1 HOUR STARTS '2019-01-02 17:05:49' ON COMPLETION PRESERVE ENABLE DO CALL reset_seq()
;;
DELIMITER ;
